INSERT INTO admin_log VALUES ('6743', '54', 'View', 'View ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ส่วนงานมีกลไกและกระบวนการวางแผนในการจัดสรรทรัพยากร การจัดสรรงบประมาณ บุคลากร เครื่องมือ และระบบงาน ที่เพียงพอต่อการดำเนินงานหรือไม่', '1', '2013-08-15 08:49:57', '127.0.0.1');
