INSERT INTO admin_log VALUES ('6745', '54', 'Add', 'Add ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : การกำหนดวัตถุประสงค์', '1', '2013-08-15 09:00:21', '127.0.0.1');
INSERT INTO admin_log VALUES ('6746', '54', 'Add', 'Add ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ส่วนงานมีการกำหนดวิสัยทัศน์ พันธกิจ วัตถุประสงค์ ตัวชี้วัด ในการดำเนินงานหรือไม่', '1', '2013-08-15 09:00:44', '127.0.0.1');
INSERT INTO admin_log VALUES ('6747', '54', 'Add', 'Add ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ผู้บริหารส่วนงานมีการกระจายอำนาจหน้าที่ ภาระงาน และอำนาจอนุมัติไปยังผู้บริหารระดับต่างๆ ตามภารกิจของส่วนงานโดยจัดทำเป็นลายลักษณ์อักษรหรือไม่', '1', '2013-08-15 09:38:05', '127.0.0.1');
INSERT INTO admin_log VALUES ('6748', '54', 'Add', 'Add ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ผู้บริหารส่วนงานให้ความสำคัญกับกระบวนการบริหารความเสี่ยงในกิจกรรมต่างๆ เพื่อหาวิธีจัดการความเสี่ยงหรือไม่', '1', '2013-08-15 09:40:44', '127.0.0.1');
INSERT INTO admin_log VALUES ('6749', '54', 'Add', 'Add ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ผู้บริหารส่วนงานมุ่งเน้นการบริหารแบบมุ่งเน้นผลงาน (Performance – Based Management)  ประกอบด้วย\n   - ส่วนงานมีวิสัยทัศน์ พันธกิจ วัตถุประสงค์ และตัวชี้วัดผลการดำเนินงาน(Key Performance Indicators) หรือไม่\n   - มีการเผยแพร่วิสัยทัศน์ พันธกิจ และเป้าหมายของการทำงาน ภายในส่วนงานเพื่อให้เกิดความเข้าใจร่วมกัน หรือไม่\n   - เป้าหมายการดำเนินงานระดับหน่วยงานและระดับกิจกรรม สอดคล้องกับเป้าหมายและวัตถุประสงค์ของส่วนงาน หรือไม่\n   - มีระบบการประเมินผลงานตามที่ได้ตกลงร่วมกันระหว่างผู้ประเมินและผู้ถูกประเมิน หรือไม่\n   - การประเมินผลการปฏิบัติงานเพื่อให้ค่าตอบแทนแก่บุคลากรขึ้นอยู่กับผลงาน หรือไม่\n   - มีการให้ข้อเสนอแนะแก่พนักงานเพื่อปรับปรุงผลงานให้เป็นไปตามเป้าหมาย หรือไม่ ', '1', '2013-08-15 09:42:27', '127.0.0.1');
INSERT INTO admin_log VALUES ('6750', '54', 'View', 'View ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ส่วนงานมีกลไกและกระบวนการวางแผนในการจัดสรรทรัพยากร การจัดสรรงบประมาณ บุคลากร เครื่องมือ และระบบงาน ที่เพียงพอต่อการดำเนินงานหรือไม่', '1', '2013-08-15 09:42:31', '127.0.0.1');
