INSERT INTO admin_log VALUES ('6792', '54', 'View', 'View ข้อมูลหัวข้อการประเมินองค์ประกอบของการควบคุมภายใน : ผู้บริหารส่วนงานมุ่งเน้นการบริหารแบบมุ่งเน้นผลงาน (Performance – Based Management)  ประกอบด้วย\n   - ส่วนงานมีวิสัยทัศน์ พันธกิจ วัตถุประสงค์ และตัวชี้วัดผลการดำเนินงาน(Key Performance Indicators) หรือไม่\n   - มีการเผยแพร่วิสัยทัศน์ พันธกิจ และเป้าหมายของการทำงาน ภายในส่วนงานเพื่อให้เกิดความเข้าใจร่วมกัน หรือไม่\n   - เป้าหมายการดำเนินงานระดับหน่วยงานและระดับกิจกรรม สอดคล้องกับเป้าหมายและวัตถุประสงค์ของส่วนงาน หรือไม่\n   - มีระบบการประเมินผลงานตามที่ได้ตกลงร่วมกันระหว่างผู้ประเมินและผู้ถูกประเมิน หรือไม่\n   - การประเมินผลการปฏิบัติงานเพื่อให้ค่าตอบแทนแก่บุคลากรขึ้นอยู่กับผลงาน หรือไม่\n   - มีการให้ข้อเสนอแนะแก่พนักงานเพื่อปรับปรุงผลงานให้เป็นไปตามเป้าหมาย หรือไม่ ', '1', '2013-08-15 17:03:35', '127.0.0.1');
