INSERT INTO est_title VALUES ('2', null, 'ปรัชญาและรูปแบบการทำงานของผู้บริหาร', '1');
INSERT INTO est_title VALUES ('3', null, 'ส่วนงานมีกลไกและกระบวนการวางแผนในการจัดสรรทรัพยากร การจัดสรรงบประมาณ บุคลากร เครื่องมือ และระบบงาน ที่เพียงพอต่อการดำเนินงานหรือไม่', '2');
INSERT INTO est_title VALUES ('4', '2544', 'การประเมินความเสี่ยง', '0');
INSERT INTO est_title VALUES ('5', null, 'การกำหนดวัตถุประสงค์', '4');
INSERT INTO est_title VALUES ('6', null, 'ส่วนงานมีการกำหนดวิสัยทัศน์ พันธกิจ วัตถุประสงค์ ตัวชี้วัด ในการดำเนินงานหรือไม่', '5');
INSERT INTO est_title VALUES ('7', null, 'ผู้บริหารส่วนงานมีการกระจายอำนาจหน้าที่ ภาระงาน และอำนาจอนุมัติไปยังผู้บริหารระดับต่างๆ ตามภารกิจของส่วนงานโดยจัดทำเป็นลายลักษณ์อักษรหรือไม่', '2');
INSERT INTO est_title VALUES ('8', null, 'ผู้บริหารส่วนงานให้ความสำคัญกับกระบวนการบริหารความเสี่ยงในกิจกรรมต่างๆ เพื่อหาวิธีจัดการความเสี่ยงหรือไม่', '2');
INSERT INTO est_title VALUES ('9', null, 'ผู้บริหารส่วนงานมุ่งเน้นการบริหารแบบมุ่งเน้นผลงาน (Performance – Based Management)  ประกอบด้วย\n   - ส่วนงานมีวิสัยทัศน์ พันธกิจ วัตถุประสงค์ และตัวชี้วัดผลการดำเนินงาน(Key Performance Indicators) หรือไม่\n   - มีการเผยแพร่วิสัยทัศน์ พันธกิจ และเป้าหมายของการทำงาน ภายในส่วนงานเพื่อให้เกิดความเข้าใจร่วมกัน หรือไม่\n   - เป้าหมายการดำเนินงานระดับหน่วยงานและระดับกิจกรรม สอดคล้องกับเป้าหมายและวัตถุประสงค์ของส่วนงาน หรือไม่\n   - มีระบบการประเมินผลงานตามที่ได้ตกลงร่วมกันระหว่างผู้ประเมินและผู้ถูกประเมิน หรือไม่\n   - การประเมินผลการปฏิบัติงานเพื่อให้ค่าตอบแทนแก่บุคลากรขึ้นอยู่กับผลงาน หรือไม่\n   - มีการให้ข้อเสนอแนะแก่พนักงานเพื่อปรับปรุงผลงานให้เป็นไปตามเป้าหมาย หรือไม่ ', '2');
INSERT INTO est_title VALUES ('10', null, 'ความซื่อสัตย์และจริยธรรม', '1');
INSERT INTO est_title VALUES ('11', null, 'มีข้อกำหนดด้านจริยธรรมในการทำงาน และบทลงโทษสำหรับผู้กระทำผิด ไว้เป็นลายลักษณ์ภายในส่วนงานหรือไม่', '10');
INSERT INTO est_title VALUES ('12', null, 'มีการประกาศ ประชุมชี้แจง เผยแพร่ข้อกำหนดด้านจริยธรรมและบทลงโทษให้พนักงานภายในส่วนงานได้รับทราบหรือไม่', '10');
INSERT INTO est_title VALUES ('13', null, 'มีกระบวนการแจ้งให้ทราบถึงความสำคัญในเรื่องความซื่อสัตย์และความมีจริยธรรมให้พนักงานทราบหรือไม่', '10');
INSERT INTO est_title VALUES ('14', null, 'ส่วนงานมีการประเมินสมรรถนะหลักของบุคลากรในด้านความยึดมั่นในคุณธรรม( Integrity) โดยพิจารณาในเรื่องความซื่อสัตย์และจริยธรรมไว้ในข้อตกลงการปฏิบัติงาน (Performance Agreement : PA) ด้วยหรือไม่ ', '10');
INSERT INTO est_title VALUES ('15', null, 'ผู้บริหารส่วนงานประพฤติตนเป็นแบบอย่างที่ดีของความซื่อสัตย์และความมีจริยธรรมหรือไม่', '10');
INSERT INTO est_title VALUES ('16', null, 'มีกระบวนการสอบสวนและลงโทษพนักงานที่ปฏิบัติงานโดยไม่ซื่อสัตย์หรือไม่', '10');
INSERT INTO est_title VALUES ('17', null, 'กระบวนการกำหนดวิสัยทัศน์ พันธกิจ วัตถุประสงค์ ของส่วนงาน ได้ให้บุคลากรที่เกี่ยวข้องมีส่วนร่วมหรือไม่', '5');
