  `sectionid` bigint(11) DEFAULT NULL COMMENT 'ภาควิชา',
  `objectiveid_1` bigint(11) DEFAULT NULL COMMENT 'วัตถุประสงค์ตามยุทธศาสตร์ของมหาวิทยาลัย',
  `objectiveid_2` bigint(11) DEFAULT NULL COMMENT 'วัตถุประสงค์ตามยุทธศาสตร์ของหน่วยงาน/ส่วนงาน',
  `objectiveid_3` bigint(11) DEFAULT NULL COMMENT 'วัตถุประสงค์ตามยุทธศาสตร์ของงาน',
  `missionid` bigint(11) DEFAULT NULL COMMENT 'ภารกิจ',
  `processid` bigint(11) DEFAULT NULL COMMENT 'กระบวนงาน',
  `event_risk` varchar(2000) DEFAULT NULL COMMENT 'เหตุการณ์ความเสี่ยง',
  `review_risk` text COMMENT 'ทบทวนเหตุการณ์ความเสี่ยง',
  `cause_in_risk` text COMMENT 'ปัจจัยภายใน',
  `cause_out_risk` text COMMENT 'ปัจจัยภายนอก',
  `remain_risk_1` bigint(11) DEFAULT NULL COMMENT 'ระดับโอกาสเกิด',
  `remain_risk_2` bigint(11) DEFAULT NULL COMMENT 'ระดับผลกระทบ',
  `remain_risk_3` bigint(11) DEFAULT NULL COMMENT 'ระดับความเสี่ยงที่เหลือ',
  `manage_risk` text COMMENT 'แนวทางการจัดการ',
  `owner_risk` varchar(255) DEFAULT NULL COMMENT 'ผู้รับผิดชอบ',
  `owner_risk_position` varchar(200) DEFAULT NULL COMMENT 'ตำแหน่ง',
  `start_date` date DEFAULT NULL COMMENT 'วันที่เริ่มดำเนินการ',
  `end_date` date DEFAULT NULL COMMENT 'วันที่เสร็จสิ้น',
  `risk_type_id` int(11) DEFAULT NULL,
  `risk_analyze` text COMMENT 'วิเคราะห์เหตุการณ์ความเสี่ยง',
  `risk_level` varchar(100) DEFAULT NULL COMMENT 'ระดับความเสี่ยง',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

